function [err, timepoints, species_out, observables_out] = BCR( timepoints, species_init, parameters, suppress_plot )
%BCR Integrate reaction network and plot observables.
%   Integrates the reaction network corresponding to the BioNetGen model
%   'BCR' and then (optionally) plots the observable trajectories,
%   or species trajectories if no observables are defined. Trajectories are
%   generated using either default or user-defined parameters and initial
%   species values. Integration is performed by the MATLAB stiff solver
%   'ode15s'. BCR returns an error value, a vector of timepoints,
%   species trajectories, and observable trajectories.
%   
%   [err, timepoints, species_out, observables_out]
%        = BCR( timepoints, species_init, parameters, suppress_plot )
%
%   INPUTS:
%   -------
%   species_init    : row vector of 1122 initial species populations.
%   timepoints      : column vector of time points returned by integrator.
%   parameters      : row vector of 27 model parameters.
%   suppress_plot   : 0 if a plot is desired (default), 1 if plot is suppressed.
%
%   Note: to specify default value for an input argument, pass the empty array.
%
%   OUTPUTS:
%   --------
%   err             : 0 if the integrator exits without error, non-zero otherwise.
%   timepoints      : a row vector of timepoints returned by the integrator.
%   species_out     : array of species population trajectories
%                        (columns correspond to species, rows correspond to time).
%   observables_out : array of observable trajectories
%                        (columns correspond to observables, rows correspond to time).
%
%   QUESTIONS about the BNG Mfile generator?  Email justinshogg@gmail.com



%% Process input arguments

% define any missing arguments
if ( nargin < 1 )
    timepoints = [];
end

if ( nargin < 2 )
    species_init = [];
end

if ( nargin < 3 )
    parameters = [];
end

if ( nargin < 4 )
    suppress_plot = 0;
end


% initialize outputs (to avoid error msgs if script terminates early
err = 0;
species_out     = [];
observables_out = [];


% setup default parameters, if necessary
if ( isempty(parameters) )
   parameters = [ 3.0e5, 10.0, 3.0e-4, 3.0e-7, 30.0, 3.0e-5, 0.3, 0.1, 3.0e-6, 0.3, 1.0e-5, 1.0e3, 30.0, 0.1, 3.0e-7, 3.0e-3, 1.0e-10, 1.0e-7, 1.0e-7, 3.0e-5, 1.0e3, 3.0e-6, 3.0e-4, 1.0, 5.0, 3, 0.0 ];
end
% check that parameters has proper dimensions
if (  size(parameters,1) ~= 1  ||  size(parameters,2) ~= 27  )
    fprintf( 1, 'Error: size of parameter argument is invalid! Correct size = [1 27].\n' );
    err = 1;
    return;
end

% setup default initial values, if necessary
if ( isempty(species_init) )
   species_init = initialize_species( parameters );
end
% check that species_init has proper dimensions
if (  size(species_init,1) ~= 1  ||  size(species_init,2) ~= 1122  )
    fprintf( 1, 'Error: size of species_init argument is invalid! Correct size = [1 1122].\n' );
    err = 1;
    return;
end

% setup default timepoints, if necessary
if ( isempty(timepoints) )
   timepoints = linspace(0,10,20+1)';
end
% check that timepoints has proper dimensions
if (  size(timepoints,1) < 2  ||  size(timepoints,2) ~= 1  )
    fprintf( 1, 'Error: size of timepoints argument is invalid! Correct size = [t 1], t>1.\n' );
    err = 1;
    return;
end

% setup default suppress_plot, if necessary
if ( isempty(suppress_plot) )
   suppress_plot = 0;
end
% check that suppress_plot has proper dimensions
if ( size(suppress_plot,1) ~= 1  ||  size(suppress_plot,2) ~= 1 )
    fprintf( 1, 'Error: suppress_plots argument should be a scalar!\n' );
    err = 1;
    return;
end

% define parameter labels (this is for the user's refe rence!)
param_labels = { 'p1', 'p2', 'p3', 'p4', 'p5', 'p6', 'p7', 'p8', 'p9', 'p10', 'p11', 'p12', 'p13', 'p14', 'p15', 'p16', 'p17', 'p18', 'p19', 'p20', 'p21', 'p22', 'p23', 'p24', 'p25', 'c', 'kp16b' };



%% Integrate Network Model
 
% calculate expressions
[expressions] = calc_expressions( parameters );

% set ODE integrator options
opts = odeset( 'RelTol',   1e-8,   ...
               'AbsTol',   0.0001,   ...
               'Stats',    'off',  ...
               'BDF',      'off',    ...
               'MaxOrder', 5   );


% define derivative function
rhs_fcn = @(t,y)( calc_species_deriv( t, y, expressions ) );


species_out_array = readtable('BCR.cdat', 'Delimiter', '  ', 'FileType', 'text');
species_out_data = table2array(species_out_array);
timepoints = species_out_data(:, 1);
species_out = species_out_data(:, 2:end);

%% Calculate derivatives at each time point
derivatives_out = zeros(size(species_out));  % Initialize the array for derivatives

% Initialize progress bar
h = waitbar(0, 'Starting calculations...');  % Opens a waitbar with initial message

% Assume 'expressions' is already calculated as part of your function
for i = 1:length(timepoints)
    derivatives_out(i, :) = calc_species_deriv(timepoints(i), species_out(i, :)', expressions);
    
    % Update progress bar to show current iteration and total
    waitbar(i / length(timepoints), h, sprintf('Calculating derivatives: %d of %d', i, length(timepoints)));
end

% Close the progress bar
close(h);


%% Save results
% Save each variable to its own .mat file
save('timepoints.mat', 'timepoints');
save('species_out.mat', 'species_out');
save('observables_out.mat', 'observables_out');
save('derivatives_out.mat', 'derivatives_out');

%% Optionally, print a confirmation
fprintf('Each variable was saved successfully in separate files.\n');


%% Plot Output, if desired





%~~~~~~~~~~~~~~~~~~~~~%
% END of main script! %
%~~~~~~~~~~~~~~~~~~~~~%

% Define if function to allow nested if statements in user-defined functions
function [val] = if__fun (cond, valT, valF)
% IF__FUN Select between two possible return values depending on the boolean
% variable COND.
    if (cond)
        val = valT;
    else
        val = valF;
    end
end

